import React from "react";
import {
  StyledNavHeader,
  StyledNavContent,
  StyledLogo,
  StyledLinks,
  StyledLinkItems,
  StyledSignIn,
  SignOutButton,
  StyledSignOut,
  Username,
} from "./Navbar.styled";
import { Container } from "../../../Styles/CommonStyles/Container";

import { Link } from "react-router-dom";

const Navbar = () => {
  return (
    <StyledNavHeader>
      <Container>
        <StyledNavContent>
          <StyledLogo>MovieNow</StyledLogo>
          <StyledLinks>
            <Link to="/">
              <StyledLinkItems>Home</StyledLinkItems>
            </Link>

            <Link to="/movies">
              <StyledLinkItems>Movies</StyledLinkItems>
            </Link>
          </StyledLinks>
        </StyledNavContent>
      </Container>
    </StyledNavHeader>
  );
};

export default Navbar;
